script: |
  super -f text -I q5754.spq | sort > q5754.out

inputs:
  - name: q5754.spq
    data: |
      SELECT ALL + col1 * - + col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE col1 * - - col2 * + + col2 + - 46 * 94 NOT IN ( - ( + col0 ), 47, col0 );
  - name: tab1

outputs:
  - name: q5754.out
    data: |
      -1344
      -295
      -3196
